Or








int value1 = 1;
int value2 = 2;

if(value1 == value2) {
   System.out.println("False");
}
if(value1 != value2) {
  System.out.println("True");
}
if(value1 > value2) {
  System.out.println("False");
}
if(value1 >= value2) {
  System.out.println("False");
}
if(value1 < value2) {
  System.out.println("True");
}
if(value1 <= value2) {
  System.out.println("True");
}


if((value1 == 1) && (value2 == 2)) {
  System.out.println("True");
}

if((value1 != 1) || (value2 >= 2)) {
  System.out.println("True");
}




